import React, { Component } from 'react';
import Pokecard from './Pokecard';
import './pokedex.css';

class Pokedex extends Component {
    render() {
        return(
            <div className="Pokedex">
                <h1>HAND ONE</h1>
                <div className="topHand">
                    {this.props.pokemon.map((p) => (
                        <Pokecard id={Math.random() * (150 - 1) + 150}/>
                    ))}
                </div>
                <h1>HAND TWO</h1>

                <div className="bottomHand">
                    {this.props.pokemon2.map((p) => (
                        <Pokecard id={this.randomID()} name={p.name} type={p.type} base_experience={p.base_experience}/>
                    ))}
                </div>
            </div>
        )
    }

    randomID(){
        let min = Math.ceil(1);
        let max = Math.floor(150);
        return Math.floor(Math.random() * (max - min)) + min;

    }
}

export default Pokedex;
